import React, {memo} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const IndexContainer = styled.div``;

const index = memo(() => {
  return (
    <IndexContainer>
      <Title title='창업지원' txt='당신의 빛나는 미래 사업을 응원합니다.' />
    </IndexContainer>
  );
});

export default index;
